INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (32, N'15d3997d-a5bd-4c81-af2c-bda9e1255b00', N'Supa crema de radacinoase cu branza de capra', N'Dupa cum stii, o supa crema de legume este o portie delicioasa de sanatate, iar daca ii mai adaugi si cateva ingrediente speciale, ii dublezi efectul benefic pentru organism. Iti propunem sa incerci o supa crema de radacinoase cu branza de capra, care te va uimi prin taxtura cremoasa si gustul deosebit de aromat.', 14, N'https://yellowcontent.blob.core.windows.net/root/1201feb7-7a88-4c46-8a38-12ce927e45c5.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (33, N'c0a33315-e37f-4ae0-aa71-099af6594d04', N'Supa de vita cu leustean proaspat', N'O supa simpla, delicioasa si sanatoasa din carne de vita frageda si legume de sezon. Leusteanul are o aroma deosebita, si numeroase proprietati nutritive precum vitamine, minerale si flavonoide. Avand un gust delicios aceasta supa este perfecta pentru un antre servit la masa de pranz.', 13, N'https://yellowcontent.blob.core.windows.net/root/81a8f5e2-a363-499a-b443-bd902a0aa134.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (34, N'2eba4d32-a103-4769-8f87-b9ef755e1d96', N'Salata mixta cu naut, masline kalamata si ardei copt', N'Iti propunem sa incerci un preparat hranitor si sanatos pregatit din bine cunoscutele boabe de naut, masline kalamata si ardei kapia copt. Alaturi de mix-ul de salate recunoscut pentru gustul delicat si calitatile nutritive, adaugand patrunjel verde, ulei de masline si zeama de lamaie, acest dish reprezinta o masa delicioasa.', 22, N'https://yellowcontent.blob.core.windows.net/root/a9797b96-3de8-4826-9332-6518663e8746.JPG', N'Yellow', N'2016-07-05 00:00:00')
