INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (6, N'a9742c15-71ea-4e9d-81d2-2b04966f771e', N'Tarta cu legume si cardamon', N'Tarta cu legume este perfecta pentru un pranz sanatos si satios pe care sa il servesti la birou. Legumele sunt fin tocate si aromate cu cardamom, care le ofera un parfum deosebit, fin si puternic, dulce si iute, o simfonie de gusturi pe care trebuie sa o incercati. Se serveste alaturi de o salata fresh de fenel.', 21, N'https://yellowcontent.blob.core.windows.net/root/1e889bfc-9c03-425a-9493-4b27e1b80c50.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (7, N'6d840d88-3cf1-40d7-a67d-422c225000d0', N'Edamame (pastai de soia)', N'Aliment foarte popular in bucataria asiatica, edemamele au patruns in ultimii ani si pe pietele din America si Europa. Soia verde seamana destul de mult cu fasolea verde: se prezinta sub forma unor teci micute, in interiorul carora sunt boabe verzi de soia.Edamamele sunt adorate atat de vegetarieni, cat si de sportivi, caci sunt o sursa excelenta de nutrienti. Contin proteine, fibre, acizi grasi omega 3 si omega 6, si cateva vitamine si minerale importante, cum ar fi vitamina A, vitamina C, vitamina K, vitamine din grupa B-urilor (B1, B2, B3, B5), magneziu, potasiu, zinc, fosfor.
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (8, N'1c3eb509-c838-455b-8fd8-3fe6877b3338', N'Somon cu sos de struguri si cartofi parizieni', N'Somonul este pestele care ofera cea mai mare cantitate de Omega 3. Aceasta reteta combina gustul puternic al somonului cu sosul dulce-acrisor de struguri si cartofii parizieni, pentru a-ti oferi o experienta deosebita.', 36, N'https://yellowcontent.blob.core.windows.net/root/1bee090c-ee2e-4810-b177-4d0e41a0418b.jpg', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (9, N'95abfdca-c441-417d-b6c3-88735f27b681', N'Pui copt in crusta de sare cu cartofi rosti si sos de trufe negre', N'O reteta culinara spectaculoasa - pui in crusta de sare, cartofi gatiti in stil elvetian si sos de smantana cu crema de trufe negre. Puiul gatit in crusta de sare capata un gust delicios de bun, cartofii rosti sunt crocanti si foarte gustosi, iar sosul de smantana cu trufe negre aduce o aroma deosebita intregului preparat.', 27, N'https://yellowcontent.blob.core.windows.net/root/87d2f015-abad-4010-96c5-bcb4c7f912db.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (10, N'63a2a95e-ad45-4668-9c49-514941660180', N'Vrabioara de vitel cu cartofi si chimichuri', N'DELICIOS- este cuvantul care descrie cel mai bine acest preparat. Vrabioara de vita, garnitura de cartofi si salsa rece din cimbru, patrunjel proaspat, ardei rosu copt, usturoi si ulei de masline. Savuros, ideal pentru masa de pranz. Toate ingredientele sunt proaspete si atent alese, iar rezultatul este un dish, scazut in calorii, plin de gusturi si arome, perfect armonizate.', 34, N'https://yellowcontent.blob.core.windows.net/root/07cadfd3-e52b-4a39-8809-25f29f9a0d9c.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (11, N'c8569541-86b8-48fb-8757-3e7548272da5', N'Lasagna cu carne de vita', N'Lasagna este unul dintre cele mai cunoscute si apreciate preparate culinare in Italia, dar si in intreaga Europa. Exista o multitudine de retete pentru acest preparat insa noi va propunem sa incercati lasagna cu carne de vita si parmezan. Carnea rosie de vita este o sursa importanta de fier necesara organismului nostru.', 27, N'https://yellowcontent.blob.core.windows.net/root/be3ea30f-5477-4ada-b0a7-8ec6a5fb852d.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (12, N'28f3f3bb-a98c-466e-bb40-f1956a410992', N'Cakeshot Framboise', N'Framboise - un desert rafinat cu o aroma delicata, gust dulce-acrisor-amarui si parfum deosebit.  Mousse-urile catifelate cu ciocolata alba si ciocolata neagra belgiana se imbina cu pandispanul pufos si zmeura delicioasa. Daca apreciezi deserturile cu ciocolata si fructe, trebuie sa incerci aceasta combinatie savuroasa.', 13, N'https://yellowcontent.blob.core.windows.net/root/7139150d-3b67-415f-ae7d-0b7d70eeb092.jpg', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (13, N'8659728a-9553-4a96-b0a6-c43a729b70f8', N'Mousse Duo Chanson', N'“Arta si savoare”, aceste cuvinte reprezinta cel mai bine acest desert. Un mousse racoritor, delicat si gustos care iti va face ziua mai frumoasa', 12, N'https://yellowcontent.blob.core.windows.net/root/c78bcda9-3fa9-47b4-91f4-6c4a9344e6b3.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (14, N'a27dc713-02aa-4a57-a43b-aced45787dde', N'Cakeshot Poire', N'Un desert delicios cu pere suculente si ciocolata belgiana aromata cu scortisoara. Stiai ca ciocolata aduce multe beneficii organismului? Trecand peste avantajele aduse sanatatii, noi credem ca cel mai mare beneficiu este acela ca "ne face fericiti". Incearca acest desert rafinat si traieste fericirea unei clipe de relaxare chiar la biroul tau.', 13, N'https://yellowcontent.blob.core.windows.net/root/c1ff25b6-7a66-482e-933c-9a82e0650bd6.jpg', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (15, N'db80477c-e383-4eee-b1e2-46220e7dcfba', N'Fresh de mere, visine si banane', N'A se agita inainte de consum.
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (16, N'62c1d314-5cb5-4131-bafc-003ef77962b5', N'Fresh de nectarine cu miere si lamaie', N'Un amestec delicios de fructe proaspete, miere naturala si lamaie. O sursa excelenta de vitamine care iti vor oferi energie pentru intreaga zi.', 12, N'https://yellowcontent.blob.core.windows.net/root/89db9a5b-a3f0-477d-84e5-1a8e20ae5b68.jpg', N'Yellow', N'2016-07-05 00:00:00')
