INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (21, N'02313ca3-70d7-4640-b4a9-94745d7e45d9', N'Piept de curcan cu legume pe pat de orez si sos de soia', N'Iti propunem o reteta delicioasa cu piept de curcan suculent asezonat cu sos de soia, legume la tigaie si orez jasmine. Un preparat gustos, hranitor si sanatos perfect pentru masa ta de pranz.', 28, N'https://yellowcontent.blob.core.windows.net/root/0ebc0093-b188-4738-b55a-b26716ec7784.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (22, N'a9742c15-71ea-4e9d-81d2-2b04966f771e', N'Tarta cu legume si cardamon', N'Tarta cu legume este perfecta pentru un pranz sanatos si satios pe care sa il servesti la birou. Legumele sunt fin tocate si aromate cu cardamom, care le ofera un parfum deosebit, fin si puternic, dulce si iute, o simfonie de gusturi pe care trebuie sa o incercati. Se serveste alaturi de o salata fresh de fenel.', 21, N'https://yellowcontent.blob.core.windows.net/root/1e889bfc-9c03-425a-9493-4b27e1b80c50.JPG', N'Yellow', N'2016-07-05 00:00:00')
INSERT INTO [dbo].[OutputMenus] ([Id], [FoodId], [Name], [Description], [Price], [Img], [Source], [CrawlTime]) VALUES (24, N'15d3997d-a5bd-4c81-af2c-bda9e1255b00', N'Supa crema de radacinoase cu branza de capra', N'Dupa cum stii, o supa crema de legume este o portie delicioasa de sanatate, iar daca ii mai adaugi si cateva ingrediente speciale, ii dublezi efectul benefic pentru organism. Iti propunem sa incerci o supa crema de radacinoase cu branza de capra, care te va uimi prin taxtura cremoasa si gustul deosebit de aromat.', 14, N'https://yellowcontent.blob.core.windows.net/root/1201feb7-7a88-4c46-8a38-12ce927e45c5.JPG', N'Yellow', N'2016-07-05 00:00:00')
